wppfm-backups“ auf dem Server hoch, auf dem Sie die Wiederherstellung durchführen möchten.','The input is not a valid email address. Please try again.'=>'Keine gültige E-Mail Adresse. Bitte überprüfen Sie Ihre Eingabe.','Notice recipient saved. A test email has been sent — check your inbox and spam folder. If you do not receive it within a few minutes, consider using an SMTP plugin as your server may not be configured for reliable email delivery.'=>'Benachrichtigungsempfänger gespeichert. Eine Test-E-Mail wurde gesendet – überprüfen Sie Ihren Posteingang und den Spam-Ordner. Wenn Sie sie innerhalb weniger Minuten nicht erhalten, sollten Sie ein SMTP-Plugin verwenden, da Ihr Server möglicherweise nicht für eine zuverlässige E-Mail-Zustellung konfiguriert ist.','Notice recipient saved, but the test email could not be delivered. Consider using an SMTP plugin to improve email delivery.'=>'Benachrichtigungsempfänger gespeichert, aber die Test-E-Mail konnte nicht zugestellt werden. Erwägen Sie die Verwendung eines SMTP-Plugins, um die E-Mail-Zustellung zu verbessern.','Notice recipient saved.'=>'Benachrichtigungsempfänger gespeichert.','There was an unknown error with the sign up process, please contact us at %s!'=>'Es ist ein unbekannter Fehler bei der Anmeldeprozedur aufgetreten. Bitte kontaktieren Sie uns unter %s!','The email you entered is not a valid email address. Please check the address again.'=>'Keine gültige E-Mail Adresse. Bitte überprüfen Sie Ihre Eingabe.','edit'=>'Bearbeiten','select'=>'Auswählen','selected'=>'Ausgewählt','delete'=>'Löschen','remove'=>'Entfernen','add'=>'Hinzufügen','if'=>'Wenn','or'=>'oder','and'=>'Und','All products from the selected Shop Categories will be included in the feed'=>'Alle Produkte aus den ausgewählten Shop-Kategorien werden in den Feed aufgenommen','Export'=>'Exportieren','Regenerate'=>'Regenerieren','Your key seems to be expired. If you are sure you have a valid key, please open a ticket at wpmarketingrobot.com/support/'=>'Ihr Schlüssel scheint abgelaufen zu sein. Wenn Sie sicher sind, dass Sie einen gültigen Schlüssel haben, öffnen Sie bitte ein Ticket unter wpmarketingrobot.com/support/support/','Plugin License Options'=>'Plugin Lizenz-Optionen','License Key'=>'Lizenzschlüssel','I accept your Terms and Conditions'=>'Ich akzeptiere die Allgemeinen Geschäftsbedingungen','Activate License'=>'Lizenz aktivieren','Feed List'=>'Feed-Liste','Feed Editor'=>'Feed-Editor','Channel Manager'=>'Kanal Manager','Settings'=>'Einstellungen','Support'=>'Support','50% Black Friday SALE!!'=>'50 % Black Friday RABATT!!','Black Friday Sale: 50% Off'=>'Black Friday Angebot: 50 % Rabatt','From November 29 to December 2, 2024.'=>'Vom 29. November bis 2. Dezember 2024.','Optimize your WooCommerce feed management with this limited-time offer!'=>'Optimieren Sie Ihr WooCommerce-Feed-Management mit diesem zeitlich begrenzten Angebot!','Get Your Deal Now!'=>'Sichern Sie sich Ihr Angebot!','Nope, I don\'t like deals!'=>'Nein danke!','don\'t show this Black Friday offer anymore'=>'Dieses Black Friday angebot nicht mehr anzeigen','Google Campaign URL Builder'=>'Google Campaign URL-Erstrellung','Feed Manager - Settings'=>'Feed-Manager Einstellungen','Auto feed fix'=>'Automatische Feed-Reparatur','Automatically try regenerating feeds that are failed (default off).'=>'Korrigiert automatisch Feeds, die fehlgeschlagen sind (standardmäßig aus). Ändern Sie diese Einstellung, wenn ein Feed immer wieder ausfällt.','Leaving this option on can put extra strain on your server when feeds keep failing.'=>'Wenn Sie diese Option aktiviert lassen, kann es zu einer erhöhten Belastung für Ihren Server kommen, wenn der Feed  weiterhin fehlschlägt.','Disable background processing'=>'Hintergrundverarbeitung deaktivieren','Process feeds directly instead of in the background (default off). Try this option when feeds keep getting stuck in processing. '=>'Der Feed wird direkt verarbeitet, anstatt im Hintergrund (Standard aus) erzeugt zu werden. Versuchen Sie es mit dieser Option, wenn Feeds in der Verarbeitung stecken bleiben. ','WARNING: When this option is selected the system can only update one feed at a time. Make sure to de-conflict your feeds auto-update schedules to prevent more than one feed auto-updates at a time.'=>'WARNUNG: Wenn diese Option ausgewählt ist, kann das System jeweils nur einen Feed aktualisieren. Stellen Sie sicher dass die Zeitpläne für die automatische Aktualisierung Ihrer Feeds nicht in Konflikt stehen, um zu verhindern dass mehrere Feeds gleichzeitig automatisch aktualisiert werden.','Feed process logger'=>'Feed-Prozess-Logger','When switched on, generates an extensive log of the feed process (default off).'=>'Generiert beim Einschalten ein umfangreiches Protokoll des Feed-Vorgangs (Standard aus).','Switch this option only on request of the help desk. '=>'Schalten Sie diese Option nur auf Anfrage des Helpdesks um. ','Show product identifiers'=>'Produktkennungen anzeigen','When switched on, adds Brand, GTIN and MPN product identifiers to the products (default off).'=>'Wenn eingeschaltet, fügt Brand, GTIN und MPN Produkt-ID-Kennungen zu den Produkten (Standard aus).','This option will add product identifier input fields to the Inventory card of your products. The MPN identifier is also added to the product variations.'=>'Mit dieser Option werden der Allgemein karte Ihrer Produkte Eingabefelder für Produktkennungen hinzugefügt. Der MPN-Bezeichner wird auch den Produktvariationen hinzugefügt.','WPML: Use full resolution URLs'=>'WPML: Verwenden Sie URLs mit voller Auflösung','Enables full conversion of hard-coded URLs (default off).'=>'Ermöglicht die vollständige Konvertierung von fest codierter URLs (Standard aus).','Use this option if you\'re using WPML and are getting incorrect URLs in your feed. This option will slightly increase the load on the database when processing a feed.'=>'Verwenden Sie diese Option, wenn Sie WPML verwenden und falsche URLs in Ihrem Feed erhalten. Diese Option erhöht die Belastung der Datenbank bei der Verarbeitung eines Feeds geringfügig.','Omit price filters'=>'Preisfilter auslassen','Omits filters that are used on the prices in your feeds (default off).'=>'Lässt Filter aus, die auf die Preise in Ihren Feeds angewendet werden (standardmäßig deaktiviert).','Enable this option to prevent third-party plugins or custom filters from altering the prices in your product feeds. Use this if you notice incorrect prices in your feed.'=>'Aktivieren Sie diese Option, um zu verhindern, dass Drittanbieter-Plugins oder benutzerdefinierte Filter die Preise in Ihren Produkt-Feeds ändern. Verwenden Sie diese Option, wenn Sie falsche Preise in Ihrem Feed feststellen.','Manual channel update'=>'Manuelle Kanalaktualisierung','When switched on, you need to manually update channels (default off).'=>'Wenn eingeschaltet, müssen Sie die Kanäle manuell aktualisieren (Standard ist aus).','By default your channels are updated automatically as soon as an update is available. This option allows your to switch off the automatic channel updates and keep your channels manually up to date.'=>'Standardmäßig werden Ihre Kanäle automatisch aktualisiert, sobald ein Update verfügbar ist. Diese Option ermöglicht es Ihnen, die automatischen Kanalaktualisierungen auszuschalten und Ihre Kanäle manuell auf dem neuesten Stand zu halten.','Clear feed process'=>'Feed-Prozess entblocken','Clear Feed Process'=>'Feed-Prozess entblocken','Use this option when feeds get stuck processing - does not delete your current feeds or settings.'=>'Wählen Sie diese Option, wenn Feeds nicht verarbeitet werden können - Ihre aktuellen Feeds oder Einstellungen werden dabei NICHT gelöscht.','Third party attributes'=>'Attribute von Drittanbietern','Enter comma separated keywords and wildcards to use third party attributes.'=>'Geben Sie kommagetrennte Schlüsselwörter und Platzhalter ein, um Attribute von Drittanbietern zu verwenden.','Use specific wildcards. Do not use to broad wildcards like %_% because that will include default WooCommerce attributes and can sometimes result in incorrect feed outputs.'=>'Verwenden Sie bestimmte Wildcards. Verwenden Sie keine breiten Wildcards wie %_%, da dies standardmäßige WooCommerce-Attribute enthält und manchmal zu falschen Feed-Ausgaben führen kann.','Notice recipient'=>'Hinweis Empfänger','Email address of the feed manager.'=>'Email-Adresse des Feed-Managers.','Enter the email address of the person you want to be notified when a feed fails during an automatic feed update. This option requires an SMTP server for WordPress to be installed on your server. If no emails are received, consider using an SMTP plugin to improve email delivery.'=>'Geben Sie die E-Mail-Adresse der Person ein, die benachrichtigt werden soll, wenn ein Feed bei einem automatischen Feed-Update fehlschlägt. Diese Option erfordert einen SMTP-Server für WordPress auf Ihrem Server. Wenn keine E-Mails zugestellt werden, sollten Sie ein SMTP-Plugin verwenden, um die E-Mail-Zustellung zu verbessern.','Re-initialize'=>'Neuinitialisierung','Re-initiate Plugin'=>'Plugin erneut initialisieren','Resets and updates the plugin.'=>'Setzt das Plugin zurück und aktualisiert es.','Updates and cleans the tables if required, re-initiates the cron events and resets the stored license - does not delete your current feeds or settings. You need to re-enter your license after this action.'=>'Aktualisiert bei Bedarf die Tabellen, initiiert die Cron-Events neu und setzt die gespeicherte Lizenz zurück - löscht nicht Ihre aktuellen Feeds oder Einstellungen.','Backups'=>'Backups','Backup Date'=>'Backup Datum','Add New Backup'=>'Neues Backup hinzufügen','Backup current feeds'=>'Aktuelle Feeds sichern','Cancel backup'=>'Backup beenden','Feed Manager - Support'=>'Feed Manager - Support','Getting started with your WooCommerce Product Feed Manager is easier than you could imagine. All our customers are not feed marketeers and we want to make your life easier.'=>'Der Einstieg in Ihren WooCommerce Product Feed Manager ist einfacher, als Sie sich vorstellen können. Alle unsere Kunden sind keine Feed-Marketer, und wir möchten Ihnen das Leben einfacher machen.','Getting Started With Product Feed Manager'=>'"Anfangen mit dem Produkt-Feed-Manager"','Please check the following articles to get started with your WooCommerce Product Feed Manager.'=>'Bitte überprüfen Sie die folgenden Artikel, um mit Ihrem WooCommerce Product Feed Manager zu beginnen.','Create a basic product feed'=>'Erstellen Ihres ersten Feeds (English)','Navigating your plugin settings dashboard'=>'Navigieren durch das Einstellungen-Dashboard (English)','Category mapping'=>'Kategoriezuordnung (English)','Adding data to a product feed attribute'=>'Das Hinzufügen von Daten zu einem Attribut (English)','Using the unique product identifier function'=>'Verwendung der Funktion für eindeutige Produktidentifikatoren (English)','How to set automatic feed updates'=>'Automatische Feed-Aktualisierungen einrichten (English)','How to use data from unsupported plugins in the feed'=>'Verwendung von Daten aus nicht unterstützten Plugins im Feed (English)','How to create repeating fields in sub-attributes'=>'Wie man wiederholende Felder in Untereigenschaften erstellt (English)','How to use the advanced product filter'=>'Verwendung des erweiterten Produktfilters (English)','The Channel Manager explained'=>'Der Kanal-Manager erklärt (English)','Frequently asked questions'=>'Häufig gestellte Fragen (English)','User Guide'=>'Start-Anleitung','Our Experts would like to assist you with your query and any help you need.'=>'Unsere Experten möchten Ihnen gerne bei Ihrer Anfrage und bei jeglicher Hilfe, die Sie benötigen, behilflich sein.','Need Expert Support?'=>'Brauchen Sie Expertenunterstützung?','Contact Support'=>'Kontaktieren Sie den Support','Download'=>'Herunterladen','Improve your Google shopping campaigns with proven, actionable steps from our detailed Google Product Feed checklist.'=>'Verbessern Sie Ihre Google-Shopping-Kampagnen mit bewährten, umsetzbaren Schritten aus unserer detaillierten Google-Produkt-Feed-Checkliste.','Free Google Shopping Checklist'=>'Kostenlose Google-Shopping-Checkliste','Thank you for requesting the Google Shopping Checklist: The Complete Guide. Please check your email for the download link.'=>'Vielen Dank, dass Sie die Google Shopping Checklist: The Complete Guide (English) angefordert haben. Bitte überprüfen Sie Ihre E-Mails für den Download-Link.','If you don\'t see it in your inbox, kindly check your spam or junk folder.'=>'Wenn Sie die E-Mail nicht in Ihrem Posteingang sehen, überprüfen Sie bitte Ihren Spam- oder Junk-Ordner.','Google Shopping Checklist'=>'Kostenlose Google-Shopping-Checkliste','We need your help to keep developing the plugin. Please review it and spread the love to keep us motivated.'=>'Wir benötigen Ihre Hilfe, um das Plugin weiterzuentwickeln. Bitte bewerten Sie es und verbreiten Sie die Liebe, um uns motiviert zu halten.','Show Your Love'=>'Zeigen Sie Ihre Liebe','Leave a Review'=>'Eine Bewertung hinterlassen','Get detailed and guided instructions to level up your feeds with the necessary setup.'=>'Erhalten Sie detaillierte und geführte Anweisungen, um Ihre Feeds mit der erforderlichen Einrichtung zu optimieren.','Documentation'=>'Dokumentation','Visit Documentation'=>'Dokumentation','Join our Facebook page for free expert marketing tips and strategies to boost your web shop sales!'=>'Treten Sie unserer Facebook-Seite bei und erhalten Sie kostenlose Expertentipps und Strategien, um den Umsatz Ihres Onlineshops zu steigern!','Join Our Facebook Page'=>'Treten Sie unserer Facebook-Seite bei','Join Facebook Page'=>'Facebook-Seite beitreten','If you need any feature on your WooCommerce Product Feed Manager that we currently do not have, please send us a request with your wishes and requirements.'=>'Wenn Sie eine Funktion für Ihren WooCommerce Product Feed Manager benötigen, die wir derzeit nicht haben, senden Sie uns bitte eine Anfrage mit Ihren Wünschen und Anforderungen.','Request a Feature'=>'Fordern Sie eine Funktion an','Required attributes'=>'Verbindliche Attribute','Highly recommended attributes'=>'Sehr empfehlenswerte Attributen','Recommended attributes'=>'Empfohlen Attributen','Optional attributes'=>'Optionale Attribute','Custom attributes'=>'Benutzerdefinierte Attribute','Attributes'=>'Attributen','From WooCommerce source'=>'WooCommerce Quelle','Condition'=>'Zustand','Feed Category'=>'Feed Kategorie','Shop Category'=>'Shop-Kategorie','Products'=>'Produkte','Product Filter'=>'Produktfilter','Save & Generate Feed'=>'Feed speichern & generieren','Save Feed'=>'Feed speichern','View Feed'=>'Feed öffnen','Use the campaign url builder to track clicks in Google Analytics and see which campaigns and products refer traffic.'=>'Verwenden Sie den Kampagnen-URL-Builder, um Klicks in Google Analytics zu verfolgen und zu sehen, welche Kampagnen und Produkte Traffic verweisen.','Fill out the required fields (market with *). Empty fields will not be added to the url.'=>'Füllen Sie die Pflichtfelder aus (mit * markiert). Leere Felder werden nicht zur URL hinzugefügt.','Click here for more info about Google Analytics'=>'Klicken Sie hier für weitere Informationen über Google Analytics','Google Analytics Tracking'=>'Google Analytics Tracking','settings at the bottom of this page'=>'Einstellungen am Ende dieser Seite','Campaign Source'=>'Kampagnenquelle','e.g. google shopping, newsletter'=>'z.B. google shopping, newsletter','Campaign Medium'=>'Kampagnenmedium','e.g. cpc, banner, email'=>'z.B. cpc, banner, email','Campaign Name'=>'Kampagnenname','e.g. feed title, spring sale'=>'z.B. feed titel, spring sale','Campaign Term'=>'Kampagnenbegriff','identify the paid keywords'=>'Keyword für die bezahlte Suche festlegen','Campaign Content'=>'Kampagnencontent','use to differentiate ads'=>'zur Unterscheidung von Anzeigen verwenden','Products source'=>'Products source','Channel'=>'Kanal','Google Feed Type'=>'Google Feed Typ','Business Type'=>'Geschäftstyp','Target Country'=>'Zielland','Default Category'=>'Standardkategorie','Aggregator Shop'=>'Aggregator Shop','Include Product Variations'=>'Produktvariationen einbeziehen','Feed Title'=>'Feed-Titel','Feed Description'=>'Feed Beschreibung','Update Schedule'=>'Update Zeitplan','Include'=>'Enthalten','Exclude'=>'Ausschließen','WP Feed Manager'=>'WP Feed Manager','Feed Manager'=>'Feed Manager','%d channel update'=>'%d Kanal Update' . "\0" . '%d Kanal Updates','Channel Manager %s'=>'Kanal Manager %s','Due to an update of your Feed Manager plugin, your feed backups are no longer valid! Please open the Feed Manager Settings page, remove all current backups, and make a new one.'=>'Aufgrund des letzten Updates sind Ihre Feed Manager Backups nicht mehr gültig! Bitte öffnen Sie die Seite Feed Manager Einstellungen, entfernen Sie alle Ihre Backups und erstellen Sie ein neues.','2121 - Activating your license failed. Please open a support ticket at %s for support on this issue.'=>'2121 - Die Aktivierung Ihrer Lizenz ist fehlgeschlagen. Bitte öffnen Sie ein Support-Ticket unter %s für Support zu diesem Thema.','An error has occurred. It is possible that the wpmarketingrobot website is down.
						Please check if wpmarketingrobot.com is still active. If not, or if this error consist, please contact
						auke@wpmarketingrobot.com. Error Message: %s'=>'Es ist ein Fehler aufgetreten. Es ist möglich, dass die Website von wpmarketingrobot nicht erreichbar ist. 
				Bitte überprüfen Sie, ob wpmarketingrobot.com noch aktiv ist. Wenn nicht, oder wenn dieser Fehler vorliegt, wenden Sie sich bitte an 
				auke@wpmarketingrobot.com. Fehlermeldung: %s','You have an invalid or expired license key for your %1$s plugin. Please %2$s to keep the plugin working and your product feeds valid.'=>'Sie haben einen ungültigen oder abgelaufenen Lizenzschlüssel für Ihr %1$s-Plugin. Bitte %2$s, um das Plugin funktionsfähig zu halten und Ihre Produkt-Feeds gültig zu halten.','click here to go to the Licenses renewal page'=>'Klicken Sie hier, um zur Lizenzverlängerungsseite zu gelangen','The license key for your %1$s plugin is expiring soon. If you wish, you can %2$s to renew your license key directly so that you can be sure your product feeds keep working.'=>'Der Lizenzschlüssel für Ihr %1$s-Plugin läuft bald ab. Falls gewünscht, können Sie %2$s, um Ihren Lizenzschlüssel direkt zu verlängern und sicherzustellen, dass Ihre Produkt-Feeds weiterhin funktionieren.','click here'=>'Klicken Sie hier','Starter Guide'=>'Start-Anleitung','Go Premium'=>'Zur Premium-Version wechseln','Get Support'=>'Hilfe erhalten','2122 - License verification failed. This may be due to a temporary issue with our server. Please wait a few minutes and try again. If the problem continues, feel free to open a support ticket at %s for further assistance.'=>'2122-Lizenzüberprüfung fehlgeschlagen. Dies kann auf ein temporäres Problem mit unserem Server zurückzuführen sein. Bitte warten Sie ein paar Minuten und versuchen Sie es erneut. Wenn das Problem weiterhin besteht, können Sie gerne ein Support-Ticket bei %s eröffnen, um weitere Unterstützung zu erhalten.',' Select the products you want in the feed by selecting the correct Shop Category and make sure the required attributes are set correctly'=>' Wählen Sie die Produkte aus, die Sie in den Feed aufnehmen möchten, indem Sie die richtige Shop-Kategorie auswählen und sicherstellen, dass die erforderlichen Attribute korrekt eingestellt sind','Click here to view the specifications for this feed.'=>'Klicken Sie hier für die Feed spezifikationen (English)','Here you can edit the parameters of your new %1$s.%2$s%3$s'=>'Hier können Sie die Parameter Ihre %1$s.%2$s%3$s Feeds bearbeiten','Here you can set up your new feed. Start by entering a name for your feed and selecting a channel.'=>'Hier können Sie Ihren neuen Feed einrichten. Geben Sie zunächst einen Namen für Ihren Feed ein und wählen Sie einen Kanal aus.','There was an error but I was unable to store the error message in the log file. The message was %s'=>'Es gab einen Fehler, die Fehlermeldung konnte jedoch nicht in der Protokolldatei gespeichert werden. Die Nachricht war %s','This plugin requires WooCommerce version %1$s as a minimum!
			It seems you have installed WooCommerce version %2$s which is a version that is not supported.
			Please update to the latest version ***'=>'Dieses Plugin benötigt mindestens WooCommerce Version %1$s! 
				Es scheint, dass Sie die WooCommerce-Version %2$s installiert haben, die eine Version ist, die nicht unterstützt wird. 
				Bitte aktualisieren Sie auf mindestens die Version 3.0.0. ***','This plugin only works in conjunction with the WooCommerce Plugin!
				It seems you have not installed and activated the WooCommerce Plugin yet, so please do so before using this Plugin.'=>'Dieses Plugin funktioniert nur in Verbindung mit dem WooCommerce Plugin! 
				Es scheint, dass Sie das WooCommerce Plugin noch nicht installiert haben, also tun Sie dies bitte, bevor Sie dieses Plugin verwenden.','You can find more information about the Woocommerce Plugin %sby clicking here</a>.'=>'Weitere Informationen über das Woocommerce Plugin %sfinden Sie hier </a>.','Brand name of the product. If the product has no brand name you can use the manufacturer or supplier name.'=>'Markenname des Produkts. Wenn das Produkt keinen Markennamen hat, können Sie den Hersteller- oder Lieferantennamen verwenden.','GTIN refers to a products Global Trade Item Number. You can also use a UPC, EAN, JAN, ISBN or ITF-14 number here.'=>'GTIN bezieht sich auf eine Produkt-Global Trade-Artikelnummer. Sie können hier auch eine UPC-, EAN-, JAN-, ISBN- oder ITF-14-Nummer verwenden.','Add your product\'s Manufacturer Part Number (MPN).'=>'Fügen Sie die Hersteller-Teilenummer (MPN) Ihres Produkts ein.','Product MPN'=>'Produkt MPN','Brand'=>'Marke','GTIN'=>'GTIN','MPN'=>'MPN','Product Feed'=>'Produkt Feed Liste','Exclude from Feed'=>'Aus dem Feed ausschließen','Activate this option to mark this product for exclusion. Use the Feed Manager Product Filter to remove marked products from feeds'=>'Aktivieren Sie diese Option, um dieses Produkt für den Ausschluss zu markieren. Verwenden Sie den Produktfilter des Feed Managers, um markierte Produkte aus Feeds zu entfernen','Activate this option to mark this product variation for exclusion. Use the Feed Manager Product Filter to remove marked products from feeds'=>'Aktivieren Sie diese Option, um diese Produktvariante für den Ausschluss zu markieren. Verwenden Sie den Produktfilter des Feed Managers, um markierte Produkte aus Feeds zu entfernen','Cloning is not allowed'=>'Das Klonen ist nicht erlaubt','Unserializing instances of this class is not allowed'=>'Das Entserialisieren von Instanzen dieser Klasse ist nicht erlaubt','WooCommerce Product Feed Manager'=>'WooCommerce Produkt Feed Manager','https://www.wpmarketingrobot.com'=>'https://www.wpmarketingrobot.com','An easy-to-use WordPress plugin that generates and submits your product feeds to merchant centres.'=>'Ein einfach zu bedienendes WordPress-Plugin, das Ihre Produktfeeds generiert und an Händlerzentren übermittelt.','WP Marketing Robot'=>'WP Marketing Robot']];
